        body: 'По его словам, дело о возвращении крупнейшего производителя авиационных двигателей и газотурбинных установок компании "Мотор Сич" (Запорожье) в государственную собственность рассматривается в Шевченковском районном суде города Киева. \n"На данный момент дело (по "Мотор Сичи") рассматривается в Шевченковском суде", - сказал он.\nОн также заявил заявил, что СНБО в ближайшее время проинформирует общество, каким способом это будет происходить.\nКак сообщалось ранее, 11 марта СНБО принял решение, согласно которому компания "Мотор Сич" будет возвращена в государственную собственность в ближайшее время. \nРанее Данилов говорил, что речь идет о его возвращении в собственность украинского народа в соответствии с действующим законодательством, а не национализации.',
