        body: 'Несколько полетов проходили в сложных погодных условиях, вызванных снежными бурями. В частности, с целью безопасной доставки груза в одном из рейсов из-за мощных снегопадов пришлось изменить аэропорт прибытия из Балтимора на Международный аэропорт Стюарт, штат Нью-Йорк. В выполнении перевозки машин, каждая из которых весит 100 т, были задействованы самолеты типа Ан-124-100 грузоподъемностью 150 т. Загрузка и разгрузка осуществлялись с помощью подъемных кранов и специального оборудования, разработанного инженерами "Авиалиний Антонова". Заказ на транспортировку оборудования для производства вакцины поступило от компании DHL Global Forwarding. Как отметил ее главный менеджер по международным перевозкам Кристофер Кляйн: "Эти чартерные рейсы стали большим проектом, который мы осуществили вместе с "Авиалиниями Антонова", в полной мере выполнив пожелания заказчика. В течение последних нескольких месяцев возник ряд трудностей, связанных с метелью на восточном побережье США, которые нужно было преодолеть. В частности, это привело к тому, что однажды нам пришлось быстро изменить аэропорт назначения". Дмитрий Просвирин, начальник департамента связей с заказчиками "Авиалиний Антонова" сказал: "Мы гордимся тем, что наша авиакомпания играет одну из ключевых ролей в глобальной борьбе с коронавирусом. Выполненные рейсы стали еще одним вкладом в это важное дело".',
        date: '21.03.21',
