        id: 22,
        headline: 'МИНИСТЕРСТВО ОБОРОНЫ КОНТРОЛИРУЕТ ГРАФИК ПОСТРОЙКИ АН-178',
        body: 'Производственный процесс продолжается даже в условиях карантина. Сейчас продолжаются работы по стапельной сборки фюзеляжа Ан-178-100Р. Завершить их планируется до 31 мая. В агрегатных цехах строят крыло, хвостовое оперение, элементы систем и другие детали. А уже в начале июня фюзеляж для первого Ан-178 запланировано снять со стапелей, чтобы пристыковать к нему крыло и установить хвостовое оперение. \n- Воздушные силы ВСУ ждут эту крылатую машину, которая должна заменить транспортные самолеты предыдущего поколения. Поэтому нам важно знать, что все работы "Антоновым" ведутся штатно даже в условиях карантина. Рассчитываем, что начатое "омоложение" армейской транспортной авиации даст толчок другим качественным изменениям всего военного авиапарка, - отметил Андрей Таран. \nПо его словам, одним из основных преимуществ Ан-178 при выборе "транспортника" для Вооруженных Сил стала способность этой модели "Антонова" опускаться на основных стойках самолета, что ускоряет загрузку-выгрузку военной техники, которая своим ходом заезжает в грузовую кабину.\n- Ан-178 является средним транспортным самолетом, созданным с применением самых современных мировых авиационных технологий, он способен перебрасывать 86 десантников, вооружение и легкую военную технику. А это уже дает преимущество по мобильности и безопасности доставки личного состава для выполнения задач обороны Украины, - добавил Андрей Таран.\nСтоит отметить, что все составляющие Ан-178-100Р, в частности, фюзеляж, крыло, хвост, построят на производственных мощностях ГП "Антонов". Другие отечественные производители поставят для этих самолетов такие важные агрегаты, как двигатели, шасси, тормозное колесо, систему управления и другие комплектующие.',
